import React from "react";

const InputField = (id, name, type, placeholder) => {
  return (
    <div className="form__group form__group">
      <label for={id?.id}>Full Name</label>
      <input
        id={id?.id}
        name={name?.name}
        type={type?.type}
        placeholder={placeholder?.placeholder}
      />
    </div>
  );
};

export default InputField;
